import React from "react";

const Leaguetable = ({ data }) => {
  console.log(data.Position);
  return (
    <>
      <div className="flex  w-full h-[60px] justify-between text-black">
        <h1>{data?.Position}</h1>
        <h1>{data.Name}</h1>
        <h1>{data.Played}</h1>
        <h1>{data.Loosed}</h1>
        <h1>Drwn</h1>
        <h1>lost</h1>
        <h1>GF</h1>
        <h1>GA</h1>
        <h1>GD</h1>
        <h1>Pnts</h1>
      </div>
      ;
    </>
  );
};

export default Leaguetable;
